function DoorStyleA()                                 -- Draws a Door Style A
  local pt2 = Polar2D(Doorpt1,   0.0, Door.Width)
  local pt3 = Polar2D(pt2,      90.0, Door.Height)
  local pt4 = Polar2D(Doorpt1,  90.0, Door.Height)
  DrawBox(Doorpt1, pt2, pt3, pt4, Door.LayerOFrame)
  local pt5 = Polar2D(Polar2D(Doorpt1,   0.0, StyleA.A), 90.0, StyleA.C)
  local pt6 = Polar2D(pt5,   0.0, (Door.Width - (StyleA.A * 2.0)))
  local pt7 = Polar2D(pt6,  90.0, (Door.Height - (StyleA.B + StyleA.C)))
  local pt8 = Polar2D(pt5,  90.0, (Door.Height - (StyleA.B + StyleA.C)))
  local ptA = Polar2D(Doorpt1, 0.0, (Door.Width * 0.5))
  local ptB = Polar2D(pt4,     0.0, (Door.Width * 0.5))
  local ptC = Polar2D(ptA,    90.0, StyleA.B)
  local ptD = Polar2D(ptB,   270.0, StyleA.C)
  if (Door.Width > StyleA.A) and  (Door.Height > (StyleA.B + StyleA.C)) then
    if (Door.Width > (StyleA.A * 2.0)) and  (Door.Height > (StyleA.B + StyleA.C)) then
      DrawBox(pt5, pt6, pt7, pt8, Door.LayerIFrame)
      if Door.Fluting == "Vertical" then
        DoorStyleAVertical(pt5, pt6, pt8)
      elseif Door.Fluting == "Horizontal" then
        DoorStyleAHorizontal(pt5, pt6, pt8)
      elseif Door.Fluting == "Crossing" then
        DoorStyleAHorizontal(pt5, pt6, pt8)
        DoorStyleAVertical(pt5, pt6, pt8)
      end -- if end
    else
      DrawLine(ptC, ptD, Door.LayerIFrame)
    end
  end -- if end
  RowPoint()
  return true
end -- function end
