function DoorStyleB()                                 -- Draws a Door Style B
  local pt2 = Polar2D(Doorpt1,   0.0, Door.Width)
  local pt3 = Polar2D(pt2,      90.0, Door.Height)
  local pt4 = Polar2D(Doorpt1,  90.0, Door.Height)
  DrawBox(Doorpt1, pt2, pt3, pt4, Door.LayerOFrame)

  local pt5 = Polar2D(Polar2D(Doorpt1, 0.0, StyleB.A), 90.0, StyleB.C)
  local pt6 = Polar2D(pt5,   0.0, (Door.Width - (StyleB.A * 2.0)))
  local pt7 = Polar2D(pt6,  90.0, (Door.Height - (StyleB.B + StyleB.C)))
  local pt8 = Polar2D(pt5,  90.0, (Door.Height - (StyleB.B + StyleB.C)))
  local pt9 = Polar2D(pt8,   0.0, StyleB.E)
  local pt0 = Polar2D(pt7, 180.0, StyleB.E)

  local chor = GetDistance(pt9, pt0)
  local seg = StyleB.B - StyleB.D
  local rad = ChordSeg2Radius (chor, seg)
  local bulge =  Radius2Bulge (pt9, pt0, rad)
  local RadGood = false
  if rad >= seg then RadGood = true end  -- Validates the Radius enough to reach the Styel.D amount
  if (Door.Width > (StyleB.A * 2.0)) and  (Door.Height > (StyleB.B + StyleB.C)) then
    if (Door.Width > (StyleB.A * 2.0) + (StyleB.E * 2.0)) and RadGood  then
      local line = Contour(0.0)
      local layer = Door.job.LayerManager:GetLayerWithName(Door.LayerIFrame)
      line:AppendPoint(pt5)
      line:LineTo(pt6)
      line:LineTo(pt7)
      line:LineTo(pt0)
      line:ArcTo(pt9, bulge)
      line:LineTo(pt8)
      line:LineTo(pt5)
      layer:AddObject(CreateCadContour(line), true)
      if Door.Fluting == "Vertical" then
        DoorStyleBVertical(pt5, pt6, pt8, rad, seg, chor)
      elseif Door.Fluting == "Horizontal" then
        DoorStyleBHorizontal(pt4, pt5, pt6, pt8, rad, chor)
      elseif Door.Fluting == "Crossing" then
        DoorStyleBHorizontal(pt4, pt5, pt6, pt8, rad, chor)
        DoorStyleBVertical(pt5, pt6, pt8, rad, seg, chor)
      end -- if end
    else
      DrawBox(pt5, pt6, pt7, pt8, Door.LayerIFrame)
    end -- if end
  end -- if end

  RowPoint()
  return true
end -- function end
-- ====================================================]]
function DoorStyleBVertical(pt5, pt6, pt8, rad, seg, chor)
  local ptA = Polar2D(pt5,   0.0, (GetDistance(pt5, pt6) * 0.5))
  local ptB = Polar2D(pt8,   0.0, (GetDistance(pt5, pt6) * 0.5))
  local ptBa = Polar2D(ptB,  90.0, seg)
  local ptC = ptA
  local ptD = ptB
  local fltCount1 = (GetDistance(pt5, pt6) / Door.FluteSpacing) - 1
  local fltCount2 = fltCount1
  local chord = Door.FluteSpacing * 2.0
  DrawLine(ptA, ptBa, Door.LayerFlutes)
  local Segment1 = (rad - (0.5 * (math.sqrt((4.0 * rad^2) - chord^2))))
  local Segment2 = (rad - (0.5 * (math.sqrt((4.0 * rad^2) - chord^2))))
  if (1.0 < fltCount1) then
    -- HERE
    local Arcstep = seg - Segment1
    while fltCount1 > 1 do
      ptA = Polar2D(ptA, 0.0, Door.FluteSpacing)
      ptB = Polar2D(ptB, 0.0, Door.FluteSpacing)
      ptBa = Polar2D(ptB, 90.0, Arcstep)
      if chor > chord then
      DrawLine(ptA, ptBa, Door.LayerFlutes)
      else
      DrawLine(ptA, ptB, Door.LayerFlutes)
      end
      fltCount1 = fltCount1 - 2
      chord = chord * 2
      Segment1 = (rad - (0.5 * (math.sqrt((4.0 * rad^2) - chord^2))))
      Arcstep = seg - Segment1
    end -- while end
    Arcstep = seg - Segment2
    chord = Door.FluteSpacing * 2.0
    while fltCount2 > 1 do
      ptC = Polar2D(ptC, 180.0, Door.FluteSpacing)
      ptD = Polar2D(ptD, 180.0, Door.FluteSpacing)
      ptBa = Polar2D(ptD, 90.0, Arcstep)
      if chor > chord then
        DrawLine(ptC, ptBa, Door.LayerFlutes)
      else
        DrawLine(ptC, ptD, Door.LayerFlutes)
      end
      fltCount2 = fltCount2 - 2
      chord = chord * 2
      Segment2 = (rad - (0.5 * (math.sqrt((4.0 * rad^2) - chord^2))))
      Arcstep = seg - Segment2
    end -- while end
  end -- if end
  return true
end -- function end
-- ====================================================]]
function DoorStyleBHorizontal(pt4, pt5, pt6, pt8, rad, chor)
  local ptA = Polar2D(pt5,  90.0, (GetDistance(pt5, pt8) * 0.5))
  local ptB = Polar2D(pt6,  90.0, (GetDistance(pt5, pt8) * 0.5))
  local ptC = ptA
  local ptD = ptB
  local fltCount1 = (GetDistance(pt5, pt8) / Door.FluteSpacing) - 1
  local fltCount2 = fltCount1
  DrawLine(ptA, ptB, Door.LayerFlutes)
  if (1.0 < fltCount1) then
    while fltCount1 > 1 do
      ptA = Polar2D(ptA, 90.0, Door.FluteSpacing)
      ptB = Polar2D(ptB, 90.0, Door.FluteSpacing)
      DrawLine(ptA, ptB, Door.LayerFlutes)
      fltCount1 = fltCount1 - 2
    end -- while end
    local ptQ = ptA
    local ptW = ptB
    while fltCount2 > 1 do
      ptC = Polar2D(ptC, 270.0, Door.FluteSpacing)
      ptD = Polar2D(ptD, 270.0, Door.FluteSpacing)
      DrawLine(ptC, ptD, Door.LayerFlutes)
      fltCount2 = fltCount2 - 2
    end -- while end
    Door.ptE = Polar2D(ptQ, 0.0, (GetDistance(pt5, pt6) * 0.5))
    Door.ptF = Polar2D(pt4, 0.0, Door.Width * 0.5)
    Door.ptG = Polar2D(Door.ptE, 90.0, Door.FluteSpacing)
    Door.ptH = Polar2D(Door.ptF,270.0, StyleB.D)
--[[
    DebugMarkPoint("Door.ptE", Door.ptE, 3, "Debug")
    DebugMarkPoint("Door.ptF", Door.ptF, 3, "Debug")
    DebugMarkPoint("Door.ptG", Door.ptG, 3, "Debug")
    DebugMarkPoint("Door.ptH", Door.ptH, 3, "Debug")
]]
    Door.fltArchCount = (GetDistance(Door.ptE, Door.ptH) / Door.FluteSpacing) - 1
    Door.Sig = GetDistance(Door.ptG, Door.ptH)
    Door.Chord = RadSeg2Chord(rad, Door.Sig)
    while Door.fltArchCount > 0 do
      ptC = Polar2D(Door.ptG, 0.0, Door.Chord * 0.5)
      ptD = Polar2D(Door.ptG, 180.0, Door.Chord * 0.5)
      DrawLine(ptC, ptD, Door.LayerFlutes)
      Door.fltArchCount = Door.fltArchCount - 1.0
  -- DebugMarkPoint("ptC", ptC, 3, "Debug")
  -- DebugMarkPoint("ptD", ptD, 3, "Debug")
    end -- while end
  end -- if end
  return true
end -- function end
