  local pt4 = Polar2D(Doorpt1,  90.0, Door.Height)
  DrawBox(Doorpt1, pt2, pt3, pt4, Door.LayerOFrame)
  local ptA = Polar2D(Polar2D(Doorpt1, 0.0, StyleG.A), 90.0, StyleG.C)
  local ptB = Polar2D(ptA,    0.0, (Door.Width - (StyleG.A * 2.0)))
  local ptC = Polar2D(ptB,   90.0, (Door.Height - (StyleG.B + StyleG.C)))
  local ptD = Polar2D(ptA,   90.0, (Door.Height - (StyleG.B + StyleG.C)))
  local pt5 = Polar2D(ptA,    0.0, StyleG.D)
  local pt6 = Polar2D(ptB,  180.0, StyleG.D)
  local pt7 = Polar2D(ptB,   90.0, StyleG.D)
  local pt8 = Polar2D(ptC,  270.0, StyleG.D)
  local pt9 = Polar2D(ptC,  180.0, StyleG.D)
  local pt10 = Polar2D(ptD,   0.0, StyleG.D)
  local pt11 = Polar2D(ptD, 270.0, StyleG.D)
  local pt12 = Polar2D(ptA,  90.0, StyleG.D)
  local bulge =  (Radius2Bulge (pt7, pt6, StyleG.D) * -1.0)
  if (Door.Width > (StyleG.A * 2.0)) and  (Door.Height > (StyleG.B + StyleG.C)) then
    if (Door.Width > (StyleG.A * 2.0) + (StyleG.D * 2.0)) then
      local line = Contour(0.0)
      local layer = Door.job.LayerManager:GetLayerWithName(Door.LayerIFrame)
      line:AppendPoint(pt5)
      line:LineTo(pt6)
      line:ArcTo(pt7, bulge)
      line:LineTo(pt8)
      line:ArcTo(pt9, bulge)
      line:LineTo(pt10)
      line:ArcTo(pt11, bulge)
      line:LineTo(pt12)
      line:ArcTo(pt5, bulge)
      layer:AddObject(CreateCadContour(line), true)
    --else
      --DrawBox(pt5, pt6, pt7, pt8, Door.LayerIFrame)
    end -- if end
  end -- if end
  RowPoint()
  return true
end -- function end
